var nonceActionEntropy = func() string {
	return hex.EncodeToString(generateRandomNonce())
}

type Contract struct {
	RawABI []byte
	Code   []byte
}

func NewContract(abi []byte, code []byte) *Contract {
	return &Contract{
		RawABI: abi,
		Code:   code,
	}
}

type importer struct {
	common

	opPublicKey     ecc.PublicKey
	actionChan      chan interface{}
	ctr             *Contract
	logger          *zap.Logger
	skipAuth        []string
	includeContract []string
}

func newImporter(opPublicKey ecc.PublicKey, dataDir string, skipAuth []string, includeContract []string, actionChan chan interface{}, logger *zap.Logger) *importer {
	if logger == nil {
		logger = zap.NewNop()
	}
	return &importer{
		common:          common{dataDir: dataDir},
		opPublicKey:     opPublicKey,
		actionChan:      actionChan,
		logger:          logger,
		skipAuth:        skipAuth,
		includeContract: includeContract,
	}
}

